from numpy import array


def function(sequence: str,
             length: int,
             interval: int,
             times: int) \
        -> list:
    patterns = {}
    for location in range(len(sequence) - length + 1):
        pattern = sequence[location: location + length]
        if pattern in patterns:
            patterns[pattern].append(location)
        else:
            patterns[pattern] = [location]

    results = []
    for k_mer, locations in patterns.items():
        locations = array(locations)
        if len(locations) >= times:
            flag = False
            for index in range(len(locations) - times + 1):
                if locations[index + times - 1] - locations[index] < interval - length:
                    flag = True
                    break
            if flag:
                results.append(k_mer)

    return results


if __name__ == '__main__':
    p_1 = ""
    p_2 = 10
    p_3 = 531
    p_4 = 16
    print(" ".join(function(p_1, p_2, p_3, p_4)))